import React from 'react';
import Section from '../Section';
import ProgressBar from '../ProgressBar';
import Separator from '../Separator';
import styles from './Skills.module.scss';

const {
  container,
  heading,
  h3,
  flexWrapper,
  paragraph,
  progressBars,
  description,
} = styles;

const Skills = () => {
  return (
    <Section tall>
      <div className={heading}>
        <h2>Skills</h2>
        <Separator />
      </div>
      <div className={flexWrapper}>
        <div className={progressBars}>
          <h3>Programming Languages</h3>
          <ProgressBar title="JavaScript" width={90} />
          <ProgressBar title="HTML" width={90} />
          <ProgressBar title="CSS, SCSS, LESS, CSS Modules" width={90} />
          <ProgressBar title="Typescript" width={80} />
          <ProgressBar title="Java" width={75} />
          <ProgressBar title="Python" width={60} />
          <ProgressBar title="C/C++" width={50} />
          <ProgressBar title="SQL/PostgreSQL" width={50} />
        </div>
        <div className={progressBars}>
          <h3>Frameworks / Software</h3>
          <ProgressBar title="React.js with Redux" width={90} />
          <ProgressBar title="Next.js" width={80} />
          <ProgressBar title="React Native" width={75} />
          <ProgressBar title="Express" width={75} />
          <ProgressBar title="Google Analytics and Tag Manager" width={75} />
          <ProgressBar title="Bugsnag" width={70} />
          <ProgressBar title="Contentful" width={70} />
          <ProgressBar title="Cypress" width={60} />
        </div>
      </div>
    </Section>
  );
};

export default Skills;
